window.bookSummaryJSON = "<p>The mysterious species called Flickers are thought to have a base in the outer solar system. A task force is sent to find out.</p> <p>Living in the Kuiper Zone, the Flicker want nothing more than to be left alone. But the solar system belongs to humans.</p> <p>Can the two coexist? Or will history repeat and contact lead to war, as has so often happened in humanity's past?</p> <p>Against a species far more advanced than the beings they call Terrans?</p>"; 
